import React from 'react';
import { Link } from 'react-router-dom';

const navItems = [
  { label: 'About', path: '/' },
  { label: 'Projects', path: '/projects' },
  { label: 'Resume', path: '/resume' },
  { label: 'Contact', path: '/contact' }
];

const Navbar = () => {
  return (
    <nav className="flex justify-center space-x-6 p-4 bg-white dark:bg-gray-900 shadow">
      {navItems.map((item) => (
        <Link key={item.path} to={item.path} className="text-lg hover:underline">
          {item.label}
        </Link>
      ))}
    </nav>
  );
};

export default Navbar;
